import React from 'react';
import SongList from './SongList';
import SongDetail from './SongDetail';

class App extends React.Component{
	render() {
		return (
			<div className="ui container">
				<div className="ui grid">
					<div className="column eight wide">
						<SongList />
					</div>
					<div className="column eight wide">
						<SongDetail />
					</div>
				</div>
			</div>
		);
	}
}

export default App;
